// Get funds from users
// Withdraw funds
// Set a minimum funding value in USD

// SPDX-License-Identifier: MIT 
pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe {

    uint256 public minUsd = 50 * 1e18;

    address[] public funders;
    mapping(address => uint256) public addressToAmountFunded;

    // payable key word makes transaction with eth available
    // makes this contract able to hold eth
    function fund() public payable {
        // Want to be able to set a minimum fund amount in USD
        //1e18 wei == 1 * 10 ** 18 == 1000000000000000000 == 1eth

        // Require parameters need to return true, else tx gets reverted
        // Reverted => undo any previous computation, send remaining gas back
        require(getConversionRate(msg.value) >= minUsd, "Didn't send enough"); 
        funders.push(msg.sender); 

        // Saves mapping of address of the caller with the value it sent 
        addressToAmountFunded[msg.sender] = msg.value;
    }

    // Rinkeby
    function getPrice() public view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        // gets the price of ETH in USD
        (,int256 price,,,) = priceFeed.latestRoundData();
        // casts int256 to uint256 as msg.value == uint256
        // adds 10 decimals to the price because msg.value == 1e18 and price == 1e8
        return uint256(price * 1e10);
    }

    function getConversionRate(uint256 ethAmount) public view returns (uint256) {
        // Calls the function to get the current eth price
        uint256 ethPrice = getPrice();
        // Convert the var passed in eth amount to USD
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18;
        // Returns the price in USD + 18 decimals
        return ethAmountInUsd; 

    }

    //function withdraw(){}


}

@chainlink/contracts/src/v0.8/interfaces.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  // getRoundData and latestRoundData should both raise "No data present"
  // if they do not have data to report, instead of returning unset values
  // which could be misinterpreted as actual reported values.
  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}

